import Header from './Components/header';
import Monitor from './Components/monitor';
import "@animxyz/core";
import { XyzTransition } from "@animxyz/react";

function App() {
  return (
    <XyzTransition appearVisable duration="auto">
    <div>
        <Header />
        <Monitor />
    </div>
    </XyzTransition>
  );
}

export default App;
